import React from 'react';
import { FaBars } from 'react-icons/fa';
import '../hojas-de.estilo/Menu.css';

function Menu({ isOpen, toggleMenu }) {
  return (
    <div className={`menu ${isOpen ? 'open' : ''}`}>
      <ul>
        <li>
          <a href="#">Inicio</a>
        </li>
        <li>
          <a href="#">Locaciones</a>
        </li>
        <li>
          <a href="#">Nosotros</a>
        </li>
        <li>
          <a href="#">Contacto</a>
        </li>
      </ul>
      <button className="menu-button" onClick={toggleMenu}>
        <FaBars />
      </button>
    </div>
  );
}

export default Menu;
